import React from 'react';

import './HowItWorks.css';
import Grid from '@material-ui/core/Grid';
const howItWorks = (props) => (
<div className="how">
    <Grid container>
        <Grid item xs={2}></Grid>
<Grid item xs={8}><h2>{props.h2}</h2></Grid>
    </Grid>

    <Grid container className="how1">
        <Grid item xs={1}></Grid>
        <Grid container xs={9}>
        <Grid item lg={6} xs={12}><img src={props.img1} alt="companies image" /></Grid>
        <Grid item lg={1} xs={0}></Grid>
        <Grid item justify="center"
  alignContent="center" lg={5} xs={12}><h3>Step 1.</h3><p>{props.s1text1}</p><br></br><p>{props.s1text2}</p><br></br><p>{props.s1text3}</p></Grid>
        </Grid>
        
    </Grid></div>
  

);

export default howItWorks;
